//var maxRowIndex = 37;
//var maxColIndex = 38;

function findneighbors(x,y,xDim,yDim)
{

    var maxColIndex = xDim-1;
    var maxRowIndex = yDim-1;

    //document.write("<p>");
    //document.write([x,y]);
    //document.write(" ");
    
    if (x == 0)
    {
        if (y == 0)
        {
            //document.write("top left corner");
            var neighbors = [[x,y+1],[x+1,y+1],[x+1,y]];
        }
        else if (y == maxRowIndex)
        {
            //document.write("bottom left corner");
            var neighbors = [[x,y-1],[x+1,y-1],[x+1,y]];
        }
        else if ((y > 0) && (y < maxRowIndex))
        {
            //document.write("left edge");
            var neighbors = [[x,y-1],[x+1,y-1],[x+1,y],[x+1,y+1],[x,y+1]];
        }
        else
        {
            //document.write("Column out of range.");
            var neighbors = [];
        }    
    }
    else if (x == maxColIndex)
    {
        if (y == 0)
        {
            //document.write("top right corner");
            var neighbors = [[x-1,y],[x-1,y+1],[x,y+1]];
        }
        else if (y == maxRowIndex)
        {
            //document.write("bottom right corner");
            var neighbors = [[x-1,y],[x-1,y-1],[x,y-1]];
        }
        else if ((y > 0) && (y < maxRowIndex))
        {
            //document.write("right edge");
            var neighbors = [[x,y-1],[x-1,y-1],[x-1,y],[x-1,y+1],[x,y+1]];
        }
        else
        {
            //document.write("Column out of range.");
            var neighbors = [];
        }        
    }
    else if ((x > 0) && (x < maxColIndex))
    {
        if (y == 0)
        {
            //document.write("top edge");
            var neighbors = [[x-1,y],[x-1,y+1],[x,y+1],[x+1,y+1],[x+1,y]];
        }
        else if (y == maxRowIndex)
        {
            //document.write("bottom edge");
            var neighbors = [[x-1,y],[x-1,y-1],[x,y-1],[x+1,y-1],[x+1,y]];
        }
        else if ((y > 0) && (y < maxRowIndex))
        {
            //document.write("center");
            var neighbors = [[x-1,y],[x-1,y+1],[x,y+1],[x+1,y+1],[x+1,y],[x+1,y-1],[x,y-1],[x-1,y-1]];
        }
        else
        {
            //document.write("Column out of range.");
            var neighbors = [];
        }        
    }
    else
    {
       //document.write("Row out of range.");
       var neighbors = [];
    }
return neighbors;
}
